import DrawerView from './Drawer-view'
import PropTypes from 'prop-types'
import React from 'react'


const Drawer = ({ location, perspective, owner }) => {
    return <DrawerView location={location} perspective={perspective} owner={owner} />
}

Drawer.propTypes = {
    location: PropTypes.string.isRequired,
    perspective: PropTypes.bool.isRequired
}

export default Drawer
